import React from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import Card from 'react-bootstrap/Card'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
function Main() {
    return (
        <Row>
            <Col>
                <Card style={cardStyle}>
                    <Card.Body>
                        Haison Nguyen
            </Card.Body>
                </Card></Col>
        </Row>
    )
}

const cardStyle = {

}
export default Main;
